// center of the application, root component that houses all others
import React from 'react';
import Nav from './components/Nav';
import About from './components/About';
import Gallery from "./components/Gallery";


function App() {
  return (
    <div>
      <Nav />
      <main>
        <Gallery />
        <About />
      </main>
    </div>
  );
}

export default App;
